// import "./app.css"

import { initializeApp } from "firebase/app";
import { signOut, getAuth } from "firebase/auth"
// import { useState } from "react";
import { useNavigate } from "react-router-dom";
function Main() {

    // const [email, setEmail] = useState("")
    // const [pswd, setPswd] = useState("")

    const navigate = useNavigate()




    const firebaseConfig = {
        apiKey: "AIzaSyClEH1wG_p4Bk7y8dl88UEi1OcSmd_7Yl4",
        authDomain: "pro-app-7adb5.firebaseapp.com",
        projectId: "pro-app-7adb5",
        storageBucket: "pro-app-7adb5.appspot.com",
        messagingSenderId: "840528707586",
        appId: "1:840528707586:web:759e54f6d5ecf02251671b",
        measurementId: "G-Q000JTLWD8"
    };

    const app = initializeApp(firebaseConfig);
    const auth = getAuth()

    const submitData = (event) => {
        event.preventDefault()

        signOut(auth)
            .then(() => {
                alert("Logout successfully")
                navigate("/Logout")
            })
            .catch(() => {
                alert("error.")
            })
    }


    return (


        <div class="container-fluid">
            <div class="row" style={{ marginTop: "15px", position:"fixed" }}>
                <div class="col" >
                    <img style={{ width: "70px", borderRadius: "60%" }} src="https://img.freepik.com/free-vector/gradient-mobile-store-logo-design_23-2149699848.jpg?w=740&t=st=1701680943~exp=1701681543~hmac=d2e55ed6996db84900ba6cfe1043d1ea415add3e10202d64e47745cee5d251c1"></img>
                </div>
                <div class="col" style={{ position: "absolute", left: "200px" }}>
                    <h3>  Mobile store</h3>
                </div>
                <div class="col">
                    <form class="d-flex" role="search" style={{ width: "500px", marginLeft: "100px", cursor: "pointer" }}>
                        <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
                        <button class="btn btn-outline-success" type="submit">Search</button>
                    </form>
                </div>
                <div class="col">
                    <i style={{ border: "1px solid black ", borderRadius: "50%", padding: "10px", cursor: "pointer",marginLeft:"100px" }} class="fa-solid fa-cart-shopping"></i>

                </div>

                <div class="col" style={{position:"absolute",leftt:"20px"}}>
                    <form onSubmit={submitData}>
                        <button type="submit" class="btn btn-danger">Logout</button>
                    </form>

                </div>
            </div>
        </div>





    )
}
export default Main;
